import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEye } from "@fortawesome/free-solid-svg-icons";
import CommentBox from "./CommentBox";
import Tabs from "react-bootstrap/Tabs";
import Tab from "react-bootstrap/Tab";

import CommentBody from "./CommentBody";

export default function VideoTitle({ title, videoHref = "#", views }) {
	return (
		<>
			<div className="single-video-title box mb-3">
				<h2>
					<a href={videoHref}>{title}</a>
				</h2>
				<p className="mb-0">
					<FontAwesomeIcon icon={faEye} /> {views} views
				</p>
			</div>
			<div className="box  single-video-comment-tabs" >
				<Tabs defaultActiveKey="vidoe" >
					<Tab eventKey="vidoe" title="Vendor Shop">
						<CommentBody />
					</Tab>
					<Tab eventKey="disqus" title="Related Products">
						<CommentBody />
					</Tab>
					<Tab eventKey="fb" title="Other's">
						<CommentBody />
					</Tab>
				</Tabs>
			</div>
		</>
	);
}
